import React from "react";
import { Link } from "react-router-dom";
import badge from "./badge.svg";
import circle from "./circle.svg";
import { PageWrapper, Image, Circle, Text } from "./Complete.style";
import Confetti from "../../global/confetti/Confetti";
import { accentColour, linkColour } from "../../global/colours";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  links: {
    fontFamily: "Josefin Sans, sans-serif",
    transition: "all 0.2s ease-in-out",
    color: linkColour,
    textDecoration: "underline",
    fontSize: "1.5rem",
    "&:hover": {
      fontSize: "1.8rem",
      color: accentColour,
    },
  },
});

const Complete = (props) => {
  const classes = useStyles();

  return (
    <>
      {/* <Confetti /> */}
      <Text>Mission Complete!</Text>
      <PageWrapper>
        <Circle src={circle} />
        <Image src={badge} />
        <Link to="/my-missions" className={classes.links}>
          Next mission unlocked
        </Link>
      </PageWrapper>
    </>
  );
};

export default Complete;
